"use strict";(self.webpackChunkdocs=self.webpackChunkdocs||[]).push([[53],{1109:e=>{e.exports=JSON.parse('{"pluginId":"default","version":"current","label":"Next","banner":null,"badge":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"defaultSidebar":[{"type":"link","label":"Overview","href":"/midas/docs/intro","docId":"intro"},{"type":"category","label":"Integration","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"VS Code","href":"/midas/docs/Integration/VSCode","docId":"Integration/VSCode"},{"type":"link","label":"Roblox","href":"/midas/docs/Integration/Roblox","docId":"Integration/Roblox"},{"type":"link","label":"PlayFab","href":"/midas/docs/Integration/PlayFab","docId":"Integration/PlayFab"},{"type":"link","label":"Power BI","href":"/midas/docs/Integration/PowerBi","docId":"Integration/PowerBi"}]},{"type":"link","label":"Teleporting Players","href":"/midas/docs/Teleportation","docId":"Teleportation"},{"type":"link","label":"Using Templates","href":"/midas/docs/Templates","docId":"Templates"},{"type":"link","label":"Series Events","href":"/midas/docs/SeriesEvents","docId":"SeriesEvents"}]},"docs":{"Integration/PlayFab":{"id":"Integration/PlayFab","title":"PlayFab","description":"In favor of producing a more accessible framework that doesn\'t require 3 hours of debugging cloud APIs for each user, we\'ve gone with a more low-tech manual method for retrieving data from PlayFab. The basic plan is that we\'ll be running a KQL script in the PlayFab data explorer, then exporting the data as a CSV.","sidebar":"defaultSidebar"},"Integration/PowerBi":{"id":"Integration/PowerBi","title":"Power BI","description":"Power BI is an amazing tool for working with complex data. It honestly feels like cheating, after you\'ve been restricted to static graphs in other services. Unlike Tableau, it\'s also free to use. There is a paid verison for $10 a month that I use - it unlocks a bunch of cool extra visualization options, however it\'s by no means mandatory.","sidebar":"defaultSidebar"},"Integration/Roblox":{"id":"Integration/Roblox","title":"Roblox","description":"Integrating the Midas framework into your game\'s code is fairly easy, however it requires pre-requisite knowledge being provided to you now.","sidebar":"defaultSidebar"},"Integration/VSCode":{"id":"Integration/VSCode","title":"VS Code","description":"To begin working with Midas you need to install the relevant wally package at `nightcycle/midas\', adding the versioning of the most recent release at the end. As a wally package it can be retrieved from throughout the game\'s code.","sidebar":"defaultSidebar"},"intro":{"id":"intro","title":"Overview","description":"The goal of this documentation is to give you everything you need to know to succeed. Setting up analytics can be complicated business, but if you follow these guides you should be up and running in now time. The integration section is especially important for first-time set-up.","sidebar":"defaultSidebar"},"SeriesEvents":{"id":"SeriesEvents","title":"Series Events","description":"Coming Soon\u2122.","sidebar":"defaultSidebar"},"Teleportation":{"id":"Teleportation","title":"Teleporting Players","description":"Coming Soon\u2122.","sidebar":"defaultSidebar"},"Templates":{"id":"Templates","title":"Using Templates","description":"Coming Soon\u2122.","sidebar":"defaultSidebar"}}}')}}]);